INSERT INTO `template` VALUES (2,'cancellation_reminder','<p>Olit varannut paikan tunnille {{event_name}}, {{location}} ({{time_start}})</p>\n\n<p>Varauksen ylläolevalle tunnille teit: {{reservation_timestamp}}</p>\n\n<p>Tuntivarausjärjestelmän mukaan et kuitenkaan saapunut paikalle, minkä johdosta lähetämme sinulle tämän huomautuksen.</p>\n\n<p>Peruutuksen tekeminen on ensiarvoisen tärkeää, sillä monelle tunnille on jonoa ja on hyvin ikävää, etteivät varapaikalla olijat pääse mukaan.</p>\n\n<p>MUISTA siis jatkossa:</p>\n\n<p>Mikäli olet estynyt tulemaan varaamallesi tunnille, tunti on peruutettava hyvissä ajoin.<br />\n	Kaikille jumppaajille toimivaa asiakaspalvelua ajatellen mieluiten vuorokautta (24h) aikaisemmin.<br />\n	Näin vapautat paikkasi muille jumppaajille.\n</p>\n',1,1,0);
INSERT INTO `template` VALUES (3,'empty','<div style=\"white-space: pre;\">{{body}}</div>',0,0,0);
INSERT INTO `template` VALUES (4,'event_reservation_queue_free','<p>olet ilmoittautunut jonopaikalle ({{event_name}} {% if time_start %}: {{time_start}}{% endif %})</p>\n\n<p>Nyt on vapautunut paikka, jonka voit varata klikkaamalla linkkiä tai kopioimalla osoitteen selaimesi osoite kenttään: </p>\n\n<p><a href=\"{{reservation_link}}\">{{reservation_link}}</a></p>\n\n<p>Tämä viesti lähtee kaikille jonoon ilmoittautuneille ja nopein varaaja saa paikan. </p>\n\n<p>Vahvista paikkasi 10 minuutin sisällä kirjautumisestasi. Tämän aikarajan jälkeen paikka ilmoitetaan uudestaan avoimeksi kaikille jonoon ilmoittautuneille.</p>',1,1,0);
INSERT INTO `template` VALUES (5,'invoice','<p>Olemme lähettäneet sinulle laskun, jonka voit avata alla olevasta linkistä.</p>\n\n<p><a href=\"{{url}}\">{{url}}</a></p>\n\n<p>Ps. Voit tarvittaessa myös tulostaa laskun käyttämällä selaimesi \'Tulosta\' -toimintoa.</p>',1,1,0);
INSERT INTO `template` VALUES (6,'invoice_pdf','<p>Ohessa liitteenä PDF-lasku. Sama lasku löytyy myös alla olevasta linkistä.</p>\n\n<p><a href=\"{{url}}\"></a>{{url}}</p>\n\n<p>Ps. Voit tarvittaessa myös ladata sekä tulostaa liitteenä olevan PDF-laskun tai tulostaa laskun suoraan selaimen `Tulosta`toiminnolla käyttäessäsi linkkiä.</p>',1,1,0);
INSERT INTO `template` VALUES (7,'manual_reservation_confirmation','<p>Hei</p>\r\n\r\n<p>Tämä on vahvistus tekemästäsi varauksesta {{ not is_course ? \'tunni\' : \'kurssi\' }}lle <strong>{{event_name}}</strong>.</p>\r\n\r\n<!-- Purchase information -->\r\n{% if fare_product %}\r\n  <p>\r\n    <strong>Ostoksen tiedot</strong><br />\r\n    Tuote: {{fare_product}}<br />\r\n    Hinta: {{sale_amount}}€<br />\r\n    ALV:n ({{vat_percentage}}%) osuus hinnasta: {{sale_vat_amount}}€\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Payer information -->\r\n{% if payer_name %}\r\n  <p>\r\n    <strong>Maksajan tiedot</strong><br />\r\n    Nimi: {{payer_name}}<br />\r\n	 {% if payer_phone_number %} Puhelinnumero: {{payer_phone_number}}<br /> {% endif %}\r\n	 {% if payer_email %} Sähköposti: {{payer_email}} {% endif %}\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Participant information -->\r\n{% if customer_name %}\r\n  <p>\r\n    <strong>Osallistujan tiedot</strong><br />\r\n    Nimi: {{customer_name}}<br />\r\n	 {% if customer_phone_number %} Puhelinnumero: {{customer_phone_number}}<br /> {% endif %}\r\n	 {% if customer_email %} Sähköposti: {{customer_email}} {% endif %}\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Course / lesson information -->\r\n<p>\r\n  <strong>{{ not is_course ? \'tunni\' : \'kurssi\' | ucfirst }}n tiedot</strong><br />\r\n  {% if reservation_group_name %}Tyyppi: {{reservation_group_name}}<br>{% endif %}\r\n  Alkamisajankohta: {{time_start}}<br />\r\n  Paikka: {{location}}\r\n</p>\r\n\r\n<!-- Course event times -->\r\n{% if is_course and lessons %}\r\n  <p>\r\n    <strong>Kurssin aikataulu</strong><br />\r\n    {% for lesson in lessons %}\r\n      {{ lesson | format_reservation_event_start_and_end_time_from_array }}<br />\r\n    {% endfor %}\r\n  </p>\r\n{% endif %}',0,1,0);
INSERT INTO `template` VALUES (8,'new_password','<p>Olet pyytänyt uutta salasanaa käyttäjätilillesi.</p>\n\n<p>\n  Käyttäjänimi / sähköpostiosoite: {{to_email }}<br />\n  Salasana: {{password }}<br />\n  Puhelinnumero: {{phone_number }}<br>\n  {% if username %}Käyttäjätunnus: {{username}}{% endif %}\n</p>\n				\n{% if confirmation_link %}\n<p>\n  Ole hyvä ja klikkaa seuraavaa linkkiä kirjautuaksesi automaattisesti järjestelmään:<br />\n  <a href=\"{{confirmation_link}}\">{{confirmation_link}}</a><br />\n  Voit myös kopioida linkin ja liittää sen selaimesi osoiteriville.</p>\n{% endif %}',1,1,0);
INSERT INTO `template` VALUES (9,'purchase_confirmation','<p>Kiitos tekemästäsi ostoksesta verkkokaupassa.</p>\r\n\r\n{% if reservation_numbers %}\r\n<p>\r\n  {% for rn in reservation_numbers %}\r\n    Paikkanumerosi tapahtumalle <b>{{rn.name}}</b> on <b>{{rn.reservation_number}}</b><br>\r\n  {% endfor %}\r\n</p>\r\n{% endif %}\r\n\r\n<p>Ostetut tuotteet:</p>\r\n\r\n{% for product in products %} \r\n  <p>\r\n    {% if not product.bundle_event_id %}<strong>{% endif %}\r\n    {{product.name ~ (product.amount ? \" - \" ~ product.amount ~ \" sis ALV: \" ~ product.vat_amount ~ \")\" : \"\")}}\r\n    {% if not product.bundle_event_id %}</strong>{% endif %}\r\n  </p>\r\n\r\n  {% if product.additional_name %}<p>Nimi: {{product.additional_name}}</p>{% endif %}\r\n\r\n  {% if product.events %}\r\n    Kurssin aikataulu:<br />\r\n    {% for event in product.events %}\r\n      {{event}}<br>\r\n    {% endfor %}\r\n\r\n    {% if product.place %}<p>{{product.place}}</p>{% endif %}\r\n  {% endif %}\r\n\r\n  {% if product.reservation_tags %}\r\n    <p>\r\n      Lisätiedot:<br>\r\n      <ul>\r\n        {% for tag in product.reservation_tags %}\r\n          <li>{{tag.name}}: {{tag.value}}</li>\r\n        {% endfor %}\r\n      </ul>\r\n    </p>\r\n  {% endif %}\r\n\r\n{% endfor %}',1,1,1);
INSERT INTO `template` VALUES (10,'registration_confirmation','<p>olet rekisteröitynyt verkkopalvelun käyttäjäksi.</p>\n\n{% if confirmation_link %}\n  <p>\n    <strong>Ole hyvä ja klikkaa seuraavaa linkkiä aktivoidaksesi sekä kirjautuaksesi automaattisesti järjestelmään:</strong><br />\n    <a href=\"{{confirmation_link}}\">{{confirmation_link}}</a><br />\n    Voit myös kopioida linkin ja liittää sen selaimesi osoiteriville. Linkki on voimassa yhden päivän, tämän jälkeen sinun tulee rekisteröityä uudelleen tai tilata uusi salasana.\n  </p>\n{% endif %}\n\n<p>\n  Henkilökohtaisen ilmoittautumisesi tiedot<br />\n  Käyttäjänimi/ sähköpostiosoite: {{to_email}}<br />\n  Puhelinnumero: {{phone_number}}\n</p>',1,1,0);
INSERT INTO `template` VALUES (11,'reservation_confirmation','<p>Kiitos varauksesta.</p>\n\n<p>Varaus: <strong>{{reservation_name}}</strong></p>\n\n{% if reservation_events %}\n  <p>\n    Kurssin aikataulu<br>\n    {% for event in reservation_events %}\n      {{event}}<br>\n    {% endfor %}\n  </p>\n{% endif %}\n\n<p>HUOM! LUETHAN TAPAHTUMAN OHJEET ENNEN TAPAHTUMAN ALKAMISTA</p>',1,1,0);
INSERT INTO `template` VALUES (12,'reservation_penalty_access_right_disabled','<p>Olit varannut paikan tunnille: {{event_name}}, {{location}} ({{time_start}})</p>\n\n<p>Varauksen ylläolevalle tunnille teit: {{reservation_timestamp}}</p>\n\n<p>\n  Tuntivarausjärjestelmän mukaan et kuitenkaan saapunut paikalle. Ensimmäisestä rikkeestä lähettämämme huomautuksen johdosta joudumme nyt valitettavasti poistamaan tuotteesi \"{{access_right_template_name}}\" käytöstä.\n</p>\n\n<p>Peruutuksen tekeminen on ensiarvoisen tärkeää, sillä monelle tunnille on jonoa ja on hyvin ikävää, etteivät varapaikalla olijat pääse mukaan.</p>\n\n<p>MUISTA siis jatkossa:</p>\n\n<p>Mikäli olet estynyt tulemaan varaamallesi tunnille, tunti on peruutettava hyvissä ajoin.<br />\n	Kaikille jumppaajille toimivaa asiakaspalvelua ajatellen mieluiten vuorokautta (24h) aikaisemmin.<br />\n	Näin vapautat paikkasi muille jumppaajille.\n</p>\n\n<p>Mikäli koet, että yllämainittu toimenpide on aiheeton, ota yhteyttä ja selvitetään asia. <br />\n	On mahdollista, että olet osallistunut varaamallesi tunnille, mutta esimerkiksi läsnäolevaksi/saapuneeksi merkintä on unohtunut tehdä.</p>\n\n<p>Kiitoksia jo etukäteen.</p>',1,1,0);
INSERT INTO `template` VALUES (13,'reservation_penalty_period_product','<p>Olit varannut paikan tunnille: {{event_name}}, {{location}} ({{time_start}})</p>\n\n<p>Varauksen ylläolevalle tunnille teit: {{reservation_timestamp}}</p>\n\n<p>Tuntivarausjärjestelmän mukaan et kuitenkaan saapunut paikalle, joten joudumme nyt valitettavasti vähentämään yhden päivän tuotteesi voimassaoloajasta.<br />\n\n<p>Tuotteesi {{access_right_template_name}} on nyt voimassa {{new_expiration}} asti.</p>\n\n<p>Peruutuksen tekeminen on ensiarvoisen tärkeää, sillä monelle tunnille on jonoa ja on hyvin ikävää, etteivät varapaikalla olijat pääse mukaan.</p>\n\n<p>MUISTA siis jatkossa:</p>\n\n<p>Mikäli olet estynyt tulemaan varaamallesi tunnille, tunti on peruutettava hyvissä ajoin.<br />\n	Kaikille jumppaajille toimivaa asiakaspalvelua ajatellen mieluiten vuorokautta (24h) aikaisemmin.<br />\n	Näin vapautat paikkasi muille jumppaajille.\n</p>\n\n<p>Mikäli koet, että yllämainittu toimenpide on aiheeton, ota yhteyttä ja selvitetään asia. <br />\n	On mahdollista, että olet osallistunut varaamallesi tunnille, mutta esimerkiksi läsnäolevaksi/saapuneeksi merkintä on unohtunut tehdä .</p>\n\n<p>Kiitoksia jo etukäteen.</p>',1,1,0);
INSERT INTO `template` VALUES (14,'reservation_penalty_reservations_blocked','<p>Olit varannut paikan tunnille: {{event_name}}, {{location}} ({{time_start}})</p>\n\n<p>Varauksen ylläolevalle tunnille teit: {{reservation_timestamp}}</p>\n\n<p>Tuntivarausjärjestelmän mukaan et kuitenkaan saapunut paikalle.</p>\n\n<p>Tilisi kautta verkossa tehtävät varaukset on nyt estetty {{reservations_blocked_until}} asti.</p>\n\n<p>Peruutuksen tekeminen on ensiarvoisen tärkeää, sillä monelle tunnille on jonoa ja on hyvin ikävää, etteivät varapaikalla olijat pääse mukaan.</p>\n\n<p>MUISTA siis jatkossa:</p>\n\n<p>Mikäli olet estynyt tulemaan varaamallesi tunnille, tunti on peruutettava hyvissä ajoin.<br />\n   Kaikille jumppaajille toimivaa asiakaspalvelua ajatellen mieluiten vuorokautta (24h) aikaisemmin.<br />\n   Näin vapautat paikkasi muille jumppaajille.\n</p>\n\n<p>Mikäli koet, että yllämainittu toimenpide on aiheeton, ota yhteyttä ja selvitetään asia. <br />\n   On mahdollista, että olet osallistunut varaamallesi tunnille, mutta esimerkiksi läsnäolevaksi/saapuneeksi merkintä on unohtunut tehdä.</p>\n\n<p>Kiitoksia jo etukäteen.</p>\n',1,1,0);
INSERT INTO `template` VALUES (15,'reservation_penalty_serial_product','<p>Olit varannut paikan tunnille: {{event_name}}, {{location}} ({{time_start}})</p>\n\n<p>Varauksen ylläolevalle tunnille teit: {{reservation_timestamp}}</p>\n\n<p>Tuntivarausjärjestelmän mukaan et kuitenkaan saapunut paikalle, joten joudumme nyt valitettavasti vähentämään yhden käyntikerran tuotteeltasi.</p>\n\n<p>Tuotteellasi {{access_right_template_name}} on nyt {{new_quantity}} käyntikertaa jäljellä.</p>\n\n<p>Peruutuksen tekeminen on ensiarvoisen tärkeää, sillä monelle tunnille on jonoa ja on hyvin ikävää, etteivät varapaikalla olijat pääse mukaan.</p>\n\n<p>MUISTA siis jatkossa:</p>\n\n<p>Mikäli olet estynyt tulemaan varaamallesi tunnille, tunti on peruutettava hyvissä ajoin.<br />\n	Kaikille jumppaajille toimivaa asiakaspalvelua ajatellen mieluiten vuorokautta (24h) aikaisemmin.<br />\n	Näin vapautat paikkasi muille jumppaajille.\n</p>\n\n<p>Mikäli koet, että yllämainittu toimenpide on aiheeton, ota yhteyttä ja selvitetään asia. <br />\n	On mahdollista, että olet osallistunut varaamallesi tunnille, mutta esimerkiksi läsnäolevaksi/saapuneeksi merkintä on unohtunut tehdä.</p>\n\n<p>Kiitoksia jo etukäteen.</p>\n',1,1,0);
INSERT INTO `template` VALUES (16,'reservation_penalty_warning','<p>Olit varannut paikan tunnille: {{event_name}}, {{location}} ({{time_start}})</p>\n\n<p>Varauksen ylläolevalle tunnille teit: {{reservation_timestamp}}</p>\n\n<p>Tuntivarausjärjestelmän mukaan et kuitenkaan saapunut paikalle, minkä johdosta lähetämme sinulle tämän huomautuksen.</p>\n\n<p>Peruutuksen tekeminen on ensiarvoisen tärkeää, sillä monelle tunnille on jonoa ja on hyvin ikävää, etteivät varapaikalla olijat pääse mukaan.</p>\n\n<p>MUISTA siis jatkossa:</p>\n\n<p>\n  Mikäli olet estynyt tulemaan varaamallesi tunnille, tunti on peruutettava hyvissä ajoin.<br />\n  Kaikille jumppaajille toimivaa asiakaspalvelua ajatellen mieluiten vuorokautta (24h) aikaisemmin.<br />\n  Näin vapautat paikkasi muille jumppaajille.\n</p>\n\n{% if apply_penalty and maximum_number_of_past_offenses %}\n  <p>\n    Tämä on huomautus numero {{number_of_past_offenses + 1}}/{{maximum_number_of_past_offenses}}.<br />\n    Kun peruuttamattomia varauksia on enemmän kuin {{maximum_number_of_past_offenses}},\n    veloitamme tuotettasi automaattisesti uuden peruuttamattoman varauksen tapahtuessa.\n  </p>\n{% endif %}\n\n<p>\n  Mikäli koet, että yllämainittu toimenpide on aiheeton, ota yhteyttä ja selvitetään asia.<br />\n  On mahdollista, että olet osallistunut varaamallesi tunnille, mutta esimerkiksi läsnäolevaksi/saapuneeksi merkintä on unohtunut tehdä.\n</p>\n\n<p>Kiitoksia jo etukäteen.</p>',1,1,0);
INSERT INTO `template` VALUES (17,'reservation_queue','<p>Olet ilmoittautunut jonopaikalle ({{reservation_name}}).</p>\n\n<p>Mikäli paikkoja vapautuu, lähetetään KAIKILLE jonoon ilmoittautuneille sähköposti vapautuneesta paikasta.\nNopein varaaja saa paikan.</p>\n\n<p>Toivottavasti pääset mukaan.</p>',1,1,0);
INSERT INTO `template` VALUES (18,'reservation_queue_free','<p>Olet ilmoittautunut jonopaikalle ({{event_name}}). Nyt on vapautunut paikka, jonka voit varata klikkaamalla tätä linkkiä (<a href=\"{{reservation_link}}\">{{reservation_link}}</a>) </p>\n\n<p>Tämä viesti lähtee kaikille jonoon ilmoittautuneille ja nopein varaaja saa paikan. </p>\n\n<p>Vahvista paikkasi 10 minuutin sisällä kirjautumisestasi. Tämän aikarajan jälkeen paikka ilmoitetaan uudestaan avoimeksi kaikille jonoon ilmoittautuneille.</p>\n\n<p>Toivottavasti pääset mukaan.</p>\n',1,1,0);
INSERT INTO `template` VALUES (19,'sap-excel-export','Liitteenä Excel-siirtotiedosto laskuista: <br />\n<br />\n{% for invoice_id in invoice_ids %}\n  {{invoice_id}}<br>\n{% endfor %}',0,0,0);
INSERT INTO `template` VALUES (20,'sap_export_notify','<p>Hei,</p>\n\n<p>\n	Olemme siirtäneet {{api_code}}:n ({{installation}}) kirjanpitoaineiston päivältä\n	{{date}} SFTP-palvelimelle.\n</p>\n\n<p>\n	Tässä lista siirretyistä tiedostoista ({{files | count }} kpl):\n</p>\n\n<p>\n  {% for file in files %}\n    {{file}}<br>\n  {% endfor %}\n</p>\n\n<p>\n  Terveisin<br/>\n   Enkora Oy<br/>\n   www.enkora.fi<br/>\n</p>',0,0,0);
INSERT INTO `template` VALUES (21,'site_created','<p>Hei {{user.name}},</p>\n\n<p>\n	Järjestelmään on perustettu uusi työmaa, johon sinut on valittu työmaapäälliköksi.<br />\n	Tässä työmaan tiedot:\n</p>\n\n<p>\n	Nimi: {{location.name }}<br />\n	{% if location.code %}Avain: {{location.code}}<br>{% endif %}\n	{% if location.external_id %}Työnumero: {{location.external_id}}<br>{% endif %}\n	Osoite: {{location.address}}<br />\n	Alkamispäivä: {{agreement.valid_from}}<br />\n	Päättymispäivä: {{agreement.valid_until}}<br />\n</p>',0,1,0);
INSERT INTO `template` VALUES (22,'user_information_changed','<p>Ilmoitus käyttäjätietojen muutoksesta</p>\n\n<p>\n	Id: {{user_id}}<br />\n	Nimi: {{user}}\n</p>\n\n<p>\n	Muutokset:\n</p>\n\n{% for change in changes %}\n    {{change.field | snakeToTitle}}:<br />\n    \"{{change.old_value}}\" => \"{{change.new_value}}\"<br />\n    <br />\n{% endfor %}',0,0,0);
INSERT INTO `template` VALUES (23,'header','Hei {{to_name}},',0,0,1);
INSERT INTO `template` VALUES (24,'footer','<p>\n  Terveisin<br />\n  Asiakaspalvelu <br />\n</p>\n\n<p>Mikäli tiedoissasi on korjattavaa tai sinulla on muuta kysyttävää tapahtumasta voit lähettää sähköpostia tai olla puhelimitse yhteydessä asiakaspalveluumme.</p>',0,0,1);
INSERT INTO `template` VALUES (25,'inventory_alert','<p>Hei,</p>\n\n<p>varastotuote {{inventory_item_name}} (ID: {{inventory_item_id}}) on alittanut varastosaldolle asetetun hälytysrajan ({{alert_quantity}} {{inventory_unit}}).</p>\n\n<p>Tuotetta jäljellä: {{remaining_quantity}} {{inventory_unit}}</p>\n\n<p>Terveisin,<br>\n Enkora Oy<br>\n www.enkora.fi\n</p>',0,0,1);
INSERT INTO `template` VALUES (27,'manual_sales_report','<p>Hei,</p>\n\n<p>Seuraavat myynnit (laite: {{device_name}}, aika: {{timestamp}}) kirjattu järjestelmään:</p>\n\n<ul>\n{% for sale in sales %}\n<li>{{sale.fare_product_name}}: {{sale.count}} kpl * {{sale.price}} € = {{sale.total_amount}} € (maksutapa {{sale.payment_type_name}})</li>\n\n{% endfor %}\n</ul>\n\n<p>Yhteismäärä per maksutapa:\n<ul>\n{% for ptt in payment_type_totals %}\n<li><b>{{ptt.name}}</b>: {{ptt.amount}} €</li>\n{% endfor %}\n</ul>\n</p>\n\n<p><b>Yhteismäärä:</b> {{total_amount}} €</p>\n\n<p>Terveisin, Enkora Oy</p>',0,0,1);
INSERT INTO `template` VALUES (78,'reservation_application_received','<p>\r\nVaraushakemuksenne on vastaanotettu.<br />\r\nVaraushakemuksen numero: {{ ids }}\r\n</p>\r\n\r\n<p>\r\nLähetämme hyväksytyistä ja hylätyistä hakemuksista tiedon sähköpostilla.\r\n</p>\r\n\r\n{% if is_detailed %}\r\n<p>\r\n<strong>Hakemuksen tiedot</strong><br />\r\n<br />\r\nHakija: \r\n{% if applicant.is_private %}\r\n	{{ applicant.contact.first_name }} {{ applicant.contact.last_name }}\r\n{% else %}\r\n	{{ applicant.organization.name }}\r\n{% endif %}\r\n<br />\r\nLaji: {{ service }}<br />\r\nIkäryhmä: {{ application_age_group }}<br />\r\nHakemuksen tyyppi: {{ reservation_recurrence }}<br />\r\nVarauksen tyyppi: {{ reservation_type }}\r\n</p>\r\n\r\n<strong>Hakemusrivit</strong>\r\n{% for row in rows %}\r\n	<p>\r\n	Viitenumero: {{ row.reservation_application_id }}<br />\r\n	Paikka: {{ row.location }}<br />\r\n	Resurssit: {{ row.resource }}<br />\r\n\r\n	{% if row.reservation_recurrence == \'recurring\' %}\r\n		Aloituspäivä: {{ row.date_start }}<br />\r\n		Päättymispäivä: {{ row.date_end }}<br />\r\n	{% endif %}\r\n	</p>\r\n\r\n<p>\r\n{% for slot in row.time_slots_formatted %}\r\n{{ slot }}<br />\r\n{% endfor %}\r\n</p>\r\n{% endfor %}\r\n\r\n{% endif %}',0,0,1);
INSERT INTO `template` VALUES (79,'course_queue_place_confirmation','Hei, \r\n\r\n<p>\r\nTämä on vahvistusviesti jonopaikasta kurssille:\r\n{{reservation_event_group}}\r\n<p>\r\n\r\n{% if events %}\r\n<strong>Kurssin aikataulu:</strong><br />\r\n{% for event in events %}\r\n{{event}}<br>\r\n{% endfor %}\r\n{% endif %}\r\n\r\n<p>\r\n<strong>Ilmoittaja:</strong><br />\r\nNimi: {{payer.first_name}} {{payer.last_name}}\r\n<br />\r\nPuhelinnumero:\r\n {{payer.phone_number}}<br />\r\nSähköposti {{payer.email}}<br />\r\n</p>\r\n\r\n{% if participants %}\r\n<strong>Osallistujat:</strong><br />\r\n{% for participant in participants %}\r\nNimi: {{participant.first_name}} {{participant.last_name}}\r\n<br />\r\nPuhelinnumero:\r\n {{participant.phone_number}}<br />\r\nSähköposti {{participant.email}}<br />\r\n<br />\r\n{% endfor %}\r\n{% endif %}',0,0,1);
INSERT INTO `template` VALUES (83,'reservation_application_rejected','<p>\r\nSeuraava/seuraavat varaushakemus/varaushakemukset on hylätty:\r\n</p>\r\n\r\n<p>\r\n	Hakija:\r\n	{% if applicant.is_private %}\r\n		{{ applicant.contact.first_name }} {{ applicant.contact.last_name }}\r\n	{% else %}\r\n		{{ applicant.organization.name }}\r\n	{% endif %}\r\n</p>\r\n\r\n{% for row in rows %}\r\n<p>\r\n	Hakemuksen numero: {{ row.reservation_application_id }}<br />\r\n	Resurssit: {{ row.resource }}<br />\r\n	{% if row.reservation_recurrence == \'recurring\' %}\r\n		Aloituspäivä: {{ row.date_start }}<br />\r\n		Päättymispäivä: {{ row.date_end }}<br />\r\n	{% else %}\r\n		Haetut päivät: <br />\r\n		{% for slot in row.time_slots_formatted %}\r\n			{{ slot }}<br />\r\n		{% endfor %}\r\n	{% endif %}\r\n</p>\r\n{% endfor %}\r\n\r\n{% if reason %}\r\n<p>Hylkäyksen syy: {{ reason }}</p>\r\n{% endif %}\r\n',0,0,1);
INSERT INTO `template` VALUES (86,'resource_reservation_confirmation','<p>\r\nTutustukaa huolella varausvahvistukseen, sillä laskutus suoritetaan vahvistuksen perusteella. Reklamaatiot varausvahvistuksesta tulee tehdä viipymättä.\r\n</p>\r\n\r\n<p>\r\nTeille on myönnetty seuraava(t) vuoro(t):\r\n</p>\r\n\r\n<p>\r\n{% for reservation in reservations %}\r\n{{ reservation | format_reservation_event_start_and_end_time_from_array }} {{reservation.resource}}<br />\r\n{% endfor %}\r\n</p>\r\n',0,0,1);
INSERT INTO `template` VALUES (242,'inventory_alert_test',' INSERT INTO `template` VALUES (244,'reservation_notification','<p>Hei,</p>\n\n<p>\nKurssi/tuntityyppi: {{reservation_event_group_id}}. {{reservation_event_group_name}}<br>\nVarausaika: {{reservation.reservation_timestamp}}<br>\nPalvelu: {{reservation.service_name}}<br>\nResurssi: {{reservation.resource_name}}\n</p>\n\n<p>\nNimi: {{customer_information.name}}<br>\nEmail: {{customer_information.email}}<br>\nPuhelin: {{customer_information.phone_number}}\n</p>\n\n\n<p>Terveisin, Enkora Oy</p>',0,0,1);
INSERT INTO `template` VALUES (245,'resource_reservation_notification','<p>Hei,</p>\r\n\r\n<p>\r\n<b>Uusi varaus tehty</b><br><br>\r\n{% if resource %}Resurssi: {{resource.name}}<br>\r\nPaikka: {{resource.location}}<br>{% endif %}\r\n{% if service %}Palvelu: {{service.name}}<br>{% endif %}\r\n</p>\r\n\r\n<p>\r\nVarauksen nimi: {{reservation_event.name}}<br>\r\nAlkuaika: {{reservation_event.time_start}}<br>\r\nLoppuaika: {{reservation_event.time_end}}\r\n</p>\r\n\r\n{% if users %}\r\n<p>\r\nVaraaja: {{users.reserved_by_user}}<br />\r\nVarattu käyttäjälle: {{users.reserved_for_user}}\r\n</p>\r\n{% endif %}\r\n\r\n<p>Terveisin, Enkora Oy</p>',0,0,1);
INSERT INTO `template` VALUES (246,'sale_below_inventory_cost','<p>Hei,</p>\n\n<p>Ilmoitus: tuote on myyty alle määritellyn rajan</p>\n\n<p>\n<b>Aika</b>: {{data.timestamp}}<br>\n<b>Tuote</b>: {{data.fare_product_name}}<br>\n<b>Kuitti ID</b>: {{data.receipt_event_id}}<br>\n<b>Myyjä</b>: {{data.user_name}}<br>\n{% if data.price %}<b>Tuotteen hinta</b>: {{data.price/100}} €<br>{% endif %}\n<b>Myyntihinta</b>: {{data.sale_amount/100}} €<br>\n<b>Varastohinta</b>: {{data.unit_cost/100}} € (viimeisin lisätty varastoerä)\n</p>\n\n<p>Terveisin, Enkora Oy</p>',0,0,1);
INSERT INTO `template` VALUES (247,'reservation_penalty_validate_only','<p>Hei,</p>\n\n<p>Kiitos, että olette käyttäneet palveluitamme. Asiakastililtänne leimattiin 1 käyntikerta varauksenne perusteella.</p>\n\n<p>Mikäli ette eilen osallistuneet tunneille niin ilmoitattehan siitä asiakaspalveluumme.</p>\n\n<p>Kiitoksia jo etukäteen.</p>\n\n<p>Terveisin<br />\n   Asiakaspalvelu<br />\n<br />\n</p>',0,0,1);
INSERT INTO `template` VALUES (250,'create_account_confirmation','<p>Tervetuloa käyttäjäksi</p>',1,1,1);
INSERT INTO `template` VALUES (251,'order_status_sent','<p>Hei,</p>\n\n<p>Tilaus {{order.order_id}} joka on luotu {{order.creation_date}} {% if buyer_name %} ja jonka on tehnyt {{buyer_name}}{% endif %} on nyt siirretty tilaan lähetetty.</p>\n\n{% if order.is_subtraction %}<p><b>Tilaus on palautustilaus!</b></p>{% endif %}\n\n<p>\n<b>Tilauksen tiedot:</b> {{order.info}}<br>\n{% if order.delivery_date %}<b>Toimituspäivä:</b> {{order.delivery_date}}<br>{% endif %}\n{% if order.delivery_address %}<b>Toimitusosoite:</b> {{order.delivery_address}}<br>{% endif %}\n</p>\n\n{% if items %}\n<p><b>Tilaukseen kuuluvat tuotteet</b><br>\n<ul>\n{% for item in items %}\n<li>{{item.inventory_item_name}} ({{item.location_name}}, {{item.inventory_quantity}}kpl, {{item.inventory_unit_cost | format_amount}} €)</li>\n{% endfor %}\n</ul>\n</p>\n{% endif %}\n\n<p>Terveisin, Enkora Oy</p>',0,0,1);
INSERT INTO `template` VALUES (252,'on_new_sale','<p>Hei,</p>\n\n<p>Uusi myynti/osto on tapahtunut. Myynnin suoritti <b>{{user_name}}</b> (käyttäjätyyppi: {{user_type_name}}) laitteella <b>{{device_name}}</b> (ID {{device_id}}).</p>\n\n<p>Myydyt/ostetut tuotteet:\n\n<ul>\n{% for fp in fare_products %}\n<li>{{fp.name}} ({{fp.count}} kpl)</li>\n{% endfor %}\n</ul>\n\n<p>Terveisin, Enkora Oy</p>',0,0,1);
INSERT INTO `template` VALUES (253,'event_cancelled_information','<p>Hei {{to_name}}, </p>\r\n<p>Valitettavasti {{type}} jolle olit osallistumassa on jouduttu perumaan. Perutun tapahtuman tarkemmat tiedot:</p>\r\n<p>Nimi: {{event_name}}</p>\r\n<p>Alkamisaika: {{time_start}}</p>\r\n<p>Paikka: {{location}}</p>\r\n<p>Pahoittelemme tapahtunutta.</p>',1,1,1);
INSERT INTO `template` VALUES (254,'community_invoice_export','<table>\r\n<tr>\r\n	<td>Tiedoston nimi</td>\r\n	<td>{{ filename }}</td>\r\n</tr>\r\n<tr>\r\n	<td>Järjestelmätunnus</td>\r\n	<td>{{ system_identifier }}</td>\r\n</tr>\r\n<tr>\r\n	<td>Yritys</td>\r\n	<td>{{ company }}</td>\r\n</tr>\r\n<tr>\r\n	<td>Käsittelijä</td>\r\n	<td>{{ handler }}</td>\r\n</tr>\r\n</table>',0,0,1);
INSERT INTO `template` VALUES (255,'order_status_delivered','<p>Hei,</p>\r\n\r\n<p>Tilaus {{order.order_id}} joka on luotu {{order.creation_date}} on nyt toimitettu.</p>\r\n\r\n{% if order.is_subtraction %}<p><b>Tilaus on palautustilaus!</b></p>{% endif %}\r\n\r\n<p>\r\n<b>Tilauksen tiedot:</b> {{order.info}}<br>\r\n{% if order.delivery_date %}<b>Toimituspäivä:</b> {{order.delivery_date}}<br>{% endif %}\r\n{% if order.delivery_address %}<b>Toimitusosoite:</b> {{order.delivery_address}}<br>{% endif %}\r\n</p>\r\n\r\n{% if items %}\r\n<p><b>Tilaukseen kuuluvat tuotteet</b><br>\r\n<ul>\r\n{% for item in items %}\r\n<li>{{item.inventory_item_name}} ({{item.location_name}}, {{item.inventory_quantity}}kpl, {{item.inventory_unit_cost | format_amount}} €)</li>\r\n{% endfor %}\r\n</ul>\r\n</p>\r\n{% endif %}\r\n\r\n<p>Terveisin, Enkora Oy</p>',0,0,1);
INSERT INTO `template` VALUES (256,'locker_open','Your locker number {{locker.locker}} has been open since {{locker.event_timestamp}}. Please close the locker.',0,0,1);
INSERT INTO `template` VALUES (257,'document_left','You have mail in locker {{locker.locker}}. Please collect it within {{locker.storage_days}} days. Locker will open when you read your ID card on the display terminal.',0,0,1);
INSERT INTO `template` VALUES (258,'document_collected','{{user.name}} has collected document from locker {{locker.locker}} at {{locker.document_collection_timestamp}}.',0,0,1);
INSERT INTO `template` VALUES (259,'ignore_previous_document_left_message','Please ignore the previous message about mail left for you in locker {{locker.locker}}.',0,0,1);
INSERT INTO `template` VALUES (260,'event_group_reservation_notification','<p>Hei {{customer_name}},</p>\n\n<p>Tämä on vahvistus tekemästäsi varauksesta {{ not is_course ? \'tunni\' : \'kurssi\' }}lle <strong>{{event_name}}</strong>.</p>\n\n<!-- Purchase information -->\n{% if fare_product %}\n  <p>\n    <strong>Ostoksen tiedot</strong><br />\n    Tuote: {{fare_product}}<br />\n    Hinta: {{sale_amount}}€<br />\n    ALV:n ({{vat_percentage}}%) osuus hinnasta: {{sale_vat_amount}}€\n  </p>\n{% endif %}\n\n<!-- Course / lesson information -->\n<p>\n  <strong>{{ not is_course ? \'tunni\' : \'kurssi\' | ucfirst }}n tiedot</strong><br />\n  {% if reservation_group_name %}Tyyppi: {{reservation_group_name}}<br>{% endif %}\n  Alkamisajankohta: {{time_start}}<br />\n  Paikka: {{location}}\n</p>\n\n<!-- Course event times -->\n{% if is_course and lessons %}\n  <p>\n    <strong>Kurssin aikataulu</strong><br />\n    {% for lesson in lessons %}\n      {{ lesson | format_reservation_event_start_and_end_time_from_array }}<br />\n    {% endfor %}\n  </p>\n{% endif %}\n',0,0,1);
INSERT INTO `template` VALUES (261,'course_reservation_confirmation','<p>Hei</p>\r\n\r\n<p>Tämä on vahvistus tekemästäsi varauksesta {{ not is_course ? \'tunni\' : \'kurssi\' }}lle <strong>{{event_name}}</strong>.</p>\r\n\r\n<!-- Purchase information -->\r\n{% if fare_product %}\r\n  <p>\r\n    <strong>Ostoksen tiedot</strong><br />\r\n    Tuote: {{fare_product}}<br />\r\n    Hinta: {{sale_amount}}€<br />\r\n    ALV:n ({{vat_percentage}}%) osuus hinnasta: {{sale_vat_amount}}€\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Payer information -->\r\n{% if payer_name %}\r\n  <p>\r\n    <strong>Maksajan tiedot</strong><br />\r\n    Nimi: {{payer_name}}<br />\r\n	 {% if payer_phone_number %} Puhelinnumero: {{payer_phone_number}}<br /> {% endif %}\r\n	 {% if payer_email %} Sähköposti: {{payer_email}} {% endif %}\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Participant information -->\r\n{% if customer_name %}\r\n  <p>\r\n    <strong>Osallistujan tiedot</strong><br />\r\n    Nimi: {{customer_name}}<br />\r\n	 {% if customer_phone_number %} Puhelinnumero: {{customer_phone_number}}<br /> {% endif %}\r\n	 {% if customer_email %} Sähköposti: {{customer_email}} {% endif %}\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Course / lesson information -->\r\n<p>\r\n  <strong>{{ not is_course ? \'tunni\' : \'kurssi\' | ucfirst }}n tiedot</strong><br />\r\n  {% if reservation_group_name %}Tyyppi: {{reservation_group_name}}<br>{% endif %}\r\n  Alkamisajankohta: {{time_start}}<br />\r\n  Paikka: {{location}}\r\n</p>\r\n\r\n<!-- Course event times -->\r\n{% if is_course and lessons %}\r\n  <p>\r\n    <strong>Kurssin aikataulu</strong><br />\r\n    {% for lesson in lessons %}\r\n      {{ lesson | format_reservation_event_start_and_end_time_from_array }}<br />\r\n    {% endfor %}\r\n  </p>\r\n{% endif %}',0,0,1);
INSERT INTO `template` VALUES (262,'course_queue_confirmation','<p>Hei</p>\r\n\r\n<p>Tämä on vahvistus tekemästäsi varauksesta {{ not is_course ? \'tunni\' : \'kurssi\' }}lle <strong>{{event_name}}</strong>.</p>\r\n\r\n<!-- Purchase information -->\r\n{% if fare_product %}\r\n  <p>\r\n    <strong>Ostoksen tiedot</strong><br />\r\n    Tuote: {{fare_product}}<br />\r\n    Hinta: {{sale_amount}}€<br />\r\n    ALV:n ({{vat_percentage}}%) osuus hinnasta: {{sale_vat_amount}}€\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Payer information -->\r\n{% if payer_name %}\r\n  <p>\r\n    <strong>Maksajan tiedot</strong><br />\r\n    Nimi: {{payer_name}}<br />\r\n	 {% if payer_phone_number %} Puhelinnumero: {{payer_phone_number}}<br /> {% endif %}\r\n	 {% if payer_email %} Sähköposti: {{payer_email}} {% endif %}\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Participant information -->\r\n{% if customer_name %}\r\n  <p>\r\n    <strong>Osallistujan tiedot</strong><br />\r\n    Nimi: {{customer_name}}<br />\r\n	 {% if customer_phone_number %} Puhelinnumero: {{customer_phone_number}}<br /> {% endif %}\r\n	 {% if customer_email %} Sähköposti: {{customer_email}} {% endif %}\r\n  </p>\r\n{% endif %}\r\n\r\n<!-- Course / lesson information -->\r\n<p>\r\n  <strong>{{ not is_course ? \'tunni\' : \'kurssi\' | ucfirst }}n tiedot</strong><br />\r\n  {% if reservation_group_name %}Tyyppi: {{reservation_group_name}}<br>{% endif %}\r\n  Alkamisajankohta: {{time_start}}<br />\r\n  Paikka: {{location}}\r\n</p>\r\n\r\n<!-- Course event times -->\r\n{% if is_course and lessons %}\r\n  <p>\r\n    <strong>Kurssin aikataulu</strong><br />\r\n    {% for lesson in lessons %}\r\n      {{ lesson | format_reservation_event_start_and_end_time_from_array }}<br />\r\n    {% endfor %}\r\n  </p>\r\n{% endif %}',0,0,1);
